  false,\n\t\"url\": null,\n\t\"notes\": \"City of Rockford Police Department Open
  Data Disclaimer:rnrnThe purpose of this dataset is to display a continuing dispatched
  Call for Service (CFS) log for the previous 72 hours. Only CFS that have been dispatched
  for at least one hour will display and the log will be refreshed once every hour.
  Some CFS have been suppressed from this log due to the sensitivity of the type of
  call. Primarily, any CFS involving sexual, domestic related or sensitive juvenile
  incidents have been suppressed.rnrnAll data contained on this site has been gathered
  through legitimate means and with the knowledge and approval of the Rockford Police
  Department. All data has been extracted, processed and presented through appropriate
  channels. rnrnData and Information: rnAll CFS data is obtained from the Police/911
  Computer Aided Dispatch (CAD) system as reported. Information is preliminary and
  subject to change as police reports are submitted. Media outlets are advised to
  confirm any information not already verified through department issued press releases.
  Data is illustrative, not an official crime report, and should not be used for comparative
  reporting. The Rockford Police Department is not responsible for any error or omission,
  misuse, or results obtained from the use of this information. Although no personal
  information is disseminated through data.illinois.gov, remember that all subjects
  are presumed innocent until proven guilty in a court of law.\",\n\t\"license_title\":
